using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> max_nesting_levels;

    int max_nesting = 0;
    int current_nesting = 0;

    for (char c : paren_string) {
        if (c == '(') {
            current_nesting++;
            if (current_nesting > max_nesting) {
                max_nesting = current_nesting;
            }
        } else if (c == ')') {
            current_nesting--;
        } else if (c == ' ') {
            max_nesting_levels.push_back(max_nesting);
            max_nesting = 0;
            current_nesting = 0;
        }
    }

    max_nesting_levels.push_back(max_nesting);

    return max_nesting_levels;
}


