vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    string current_group;

    // Remove spaces from the input string
    string input_string_no_spaces;
    for (char c : paren_string) {
        if (c != ' ') {
            input_string_no_spaces += c;
        }
    }

    // Extract separate groups of nested parentheses
    int open_count = 0;
    for (char c : input_string_no_spaces) {
        if (c == '(') {
            open_count++;
        } else if (c == ')') {
            open_count--;
        }

        current_group += c;

        if (open_count == 0) {
            result.push_back(current_group);
            current_group = "";
        }
    }

    return result;
}


