bool is_palindrome(string str) {
    string s(str.rbegin(), str.rend());
    return s == str;
}

string find_longest_palindromic_suffix(string str) {
    string longest_suffix = "";
    for (int i = str.length() - 1; i >= 0; i--) {
        string suffix = str.substr(i);
        if (is_palindrome(suffix) && suffix.length() > longest_suffix.length()) {
            longest_suffix = suffix;
        }
    }
    return longest_suffix;
}

string reverse_prefix(string str, string suffix) {
    int prefix_length = str.length() - suffix.length();
    string prefix = str.substr(0, prefix_length);
    string reversed_prefix(prefix.rbegin(), prefix.rend());
    return reversed_prefix;
}

string make_palindrome(string str) {
    string longest_suffix = find_longest_palindromic_suffix(str);
    string reversed_prefix = reverse_prefix(str, longest_suffix);
    return str + reversed_prefix;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

