string string_xor(string a, string b) {
    // Validate input strings a and b
    for (char c : a) {
        if (c != '0' && c != '1') {
            return "Invalid input";
        }
    }
    for (char c : b) {
        if (c != '0' && c != '1') {
            return "Invalid input";
        }
    }

    // Perform binary XOR operation
    string result = "";
    for (int i = 0; i < a.size(); i++) {
        if (a[i] == b[i]) {
            result += '0';
        } else {
            result += '1';
        }
    }

    return result;
}

