std::pair<float, float> find_closest_elements(const std::vector<float>& numbers) {
    if (numbers.size() < 2) {
        throw std::invalid_argument("Input vector must have at least two elements");
    }

    std::vector<float> sortedNumbers = numbers;
    std::sort(sortedNumbers.begin(), sortedNumbers.end());

    float minDiff = std::abs(sortedNumbers[1] - sortedNumbers[0]);
    std::pair<float, float> closestPair(sortedNumbers[0], sortedNumbers[1]);

    for (size_t i = 1; i < sortedNumbers.size() - 1; ++i) {
        float diff = std::abs(sortedNumbers[i + 1] - sortedNumbers[i]);
        if (diff < minDiff) {
            minDiff = diff;
            closestPair = {sortedNumbers[i], sortedNumbers[i + 1]};
        }
    }

    return closestPair;
}


