string sort_numbers(string numbers) {
    map<string, int> numberMap = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    vector<string> numberWords;
    string word = "";
    for (char c : numbers) {
        if (c == ' ') {
            numberWords.push_back(word);
            word = "";
        } else {
            word += c;
        }
    }
    numberWords.push_back(word);

    vector<int> numericalValues;
    for (string num : numberWords) {
        numericalValues.push_back(numberMap[num]);
    }

    sort(numericalValues.begin(), numericalValues.end());

    string sortedNumbers = "";
    for (int num : numericalValues) {
        for (auto it : numberMap) {
            if (it.second == num) {
                sortedNumbers += it.first + " ";
                break;
            }
        }
    }

    sortedNumbers.pop_back(); // Remove the extra space at the end
    return sortedNumbers;
}


