int countDigit7(int num) {
    int count = 0;
    while (num > 0) {
        if (num % 10 == 7) {
            count++;
        }
        num /= 10;
    }
    return count;
}

int fizz_buzz(int n) {
    int total = 0;
    for (int i = 1; i < n; i++) {
        if (isDivisibleBy11Or13(i)) {
            total += countDigit7(i);
        }
    }
    return total;
}


