bool is_prime(int num) {
    if (num <= 1) {
        return false;
    }
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) {
            return false;
        }
    }
    return true;
}

int prime_fib(int n) {
    if (n <= 0) {
        return -1; // Invalid input
    }

    int first = 0, second = 1, next, count = 2; // Start with 2 as we already know the first two prime Fibonacci numbers

    while (count < n) {
        next = first + second;
        first = second;
        second = next;
        if (is_prime(next)) {
            count++;
        }
    }

    return second;
}


