float median(vector<float> l) {
    sort(l.begin(), l.end()); // Sort the elements in the vector in ascending order

    int size = l.size(); // Calculate the size of the vector

    if (size % 2 != 0) { // Check if the size of the vector is odd
        return l[size / 2]; // Return the middle element of the sorted vector
    } else {
        return (l[size / 2 - 1] + l[size / 2]) / 2.0; // Return the average of the two middle elements of the sorted vector
    }
}


