    std::vector<int> right_to_left(n);

    // Initialize the initial positions of the cars moving left to right and right to left
    for (int i = 0; i < n; i++) {
        left_to_right[i] = i * 2; // Assuming cars are initially spaced 2 units apart
        right_to_left[i] = i * 2 + 1; // Assuming cars are initially spaced 2 units apart
    }

    int collisions = 0;

    // Calculate the time it takes for the cars to collide and count the number of collisions
    for (int i = 0; i < n; i++) {
        int time_to_collision = (right_to_left[i] - left_to_right[i]) / 2; // Assuming cars move at speed 1 unit per time step
        if (time_to_collision >= 0) {
            collisions++;
        }
    }

    return collisions;
}


