int modp(int n, int p) {
    if (p == 1) {
        return 0;
    }

    long long result = 1;
    long long base = 2;

    while (n > 0) {
        if (n % 2 == 1) {
            result = (result * base) % p;
        }
        n = n / 2;
        base = (base * base) % p;
    }

    return result;
}


