bool is_prime(int num) {
    if (num <= 1) {
        return false;
    }
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) {
            return false;
        }
    }
    return true;
}

std::vector<int> find_factors(int num) {
    std::vector<int> factors;
    for (int i = 2; i <= num; i++) {
        if (num % i == 0) {
            factors.push_back(i);
        }
    }
    return factors;
}

std::vector<int> find_prime_factors(const std::vector<int>& factors) {
    std::vector<int> prime_factors;
    for (int factor : factors) {
        if (is_prime(factor)) {
            prime_factors.push_back(factor);
        }
    }
    return prime_factors;
}

int largest_prime_factor(int n) {
    std::vector<int> factors = find_factors(n);
    std::vector<int> prime_factors = find_prime_factors(factors);

    int largest_prime = 0;
    for (int prime : prime_factors) {
        if (prime > largest_prime) {
            largest_prime = prime;
        }
    }

    return largest_prime;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (largest_prime_factor(15) == 5);
    assert (largest_prime_factor(27) == 3);
    assert (largest_prime_factor(63) == 7);
    assert (largest_prime_factor(330) == 11);
    assert (largest_prime_factor(13195) == 29);
}

