vector<int> common(vector<int> l1, vector<int> l2) {
    set<int> unique1(l1.begin(), l1.end());
    set<int> unique2(l2.begin(), l2.end());

    set<int> commonElements;

    for (int num : unique1) {
        if (unique2.find(num) != unique2.end()) {
            commonElements.insert(num);
        }
