bool correct_bracketing(string brackets) {
    if (brackets.empty()) {
        return false;
    }

    int openCount = 0;
    int closeCount = 0;

    for (char c : brackets) {
        if (c == '(') {
            openCount++;
        } else if (c == ')') {
            closeCount++;
            if (closeCount > openCount) {
                return false;
            }
        }
    }

    return openCount == closeCount;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (correct_bracketing("()"));
    assert (correct_bracketing("(()())"));
    assert (correct_bracketing("()()(()())()"));
    assert (correct_bracketing("()()((()()())())(()()(()))"));
    assert (not (correct_bracketing("((()())))")));
    assert (not (correct_bracketing(")(()")));
    assert (not (correct_bracketing("(")));
    assert (not (correct_bracketing("((((")));
    assert (not (correct_bracketing(")")));
    assert (not (correct_bracketing("(()")));
    assert (not (correct_bracketing("()()(()())())(()")));
    assert (not (correct_bracketing("()()(()())()))()")));
}

