    bool yVowel = false;

    for (int i = 0; i < s.length(); i++) {
        char c = tolower(s[i]);
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            count++;
            yVowel = false;
        } else if (c == 'y' && i == s.length() - 1) {
            if (!yVowel) {
                count++;
                yVowel = true;
            }
        } else {
            yVowel = false;
        }
    }

    return count;
}


