string circular_shift(int x, int shift) {
    string result = "";
    int numDigits = to_string(x).length();
    int effectiveShift = shift % numDigits;

    if (effectiveShift == 0) {
        return to_string(x);
    }

    string strX = to_string(x);
    string shiftedStr = strX.substr(numDigits - effectiveShift) + strX.substr(0, numDigits - effectiveShift);

    return shiftedStr;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (circular_shift(100, 2) == "001");
    assert (circular_shift(12, 2) == "12");
    assert (circular_shift(97, 8) == "79");
    assert (circular_shift(12, 1) == "21");
    assert (circular_shift(11, 101) == "11");
}

