int fruit_distribution(string s, int n) {
    int totalApples = 0;
    int totalOranges = 0;

    // Extract the number of apples and oranges from the input string
    stringstream ss(s);
    string fruit;
    int quantity;
    while (ss >> quantity >> fruit) {
        if (fruit == "apples") {
            totalApples = quantity;
        } else if (fruit == "oranges") {
            totalOranges = quantity;
        }
    }

    // Calculate the total number of apples and oranges
    int totalApplesOranges = totalApples + totalOranges;

    // Subtract the total number of apples and oranges from the total number of fruits in the basket
    int mangoFruits = n - totalApplesOranges;

    return mangoFruits;
}


