int search(vector<int> lst) {
    std::unordered_map<int, int> freqMap;

    for (int num : lst) {
        freqMap[num]++;
    }

    int result = -1;
    for (const auto& pair : freqMap) {
        if (pair.second >= pair.first && pair.first > result) {
            result = pair.first;
        }
    }

    return result;
}


