bool is_palindromic(const std::vector<int>& q) {
    int start = 0;
    int end = q.size() - 1;

    while (start < end) {
        if (q[start] != q[end]) {
            return false;
        }
        start++;
        end--;
    }

    return true;
}

bool will_it_fly(const std::vector<int>& q, int w) {
    if (!is_palindromic(q)) {
        return false;
    }

    int sum = 0;
    for (int num : q) {
        sum += num;
    }

    return sum <= w;
}


