string solve(int N) {
    int sum = 0;

    // Extracting individual digits and calculating the sum
    while (N > 0) {
        sum += N % 10;
        N /= 10;
    }

    // Converting the sum into binary
    string binary = "";
    while (sum > 0) {
        binary = to_string(sum % 2) + binary;
        sum /= 2;
    }

    // Handling the case when the sum is 0
    if (binary == "") {
        binary = "0";
    }

    return binary;
}

