std::string encrypt(std::string s) {
    std::string result = "";
    std::string alphabet = "abcdefghijklmnopqrstuvwxyz";

    for (char& c : s) {
        if (isalpha(c)) {
            int index = alphabet.find(tolower(c));
            if (index != std::string::npos) {
                int rotated_index = (index + 2 * 2) % 26;
                char rotated_char = isupper(c) ? toupper(alphabet[rotated_index]) : alphabet[rotated_index];
                result += rotated_char;
            }
        } else {
            result += c;
        }
    }

    return result;
}


