bool isPrime(int num) {
    if (num <= 1) {
        return false;
    }
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) {
            return false;
        }
    }
    return true;
}

int sumOfDigits(int num) {
    int sum = 0;
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return sum;
}

int findLargestPrimeSum(const vector<int>& lst) {
    vector<int> primeNumbers;
    for (int num : lst) {
        if (isPrime(num)) {
            primeNumbers.push_back(num);
        }
    }

    if (primeNumbers.empty()) {
        return 0;
    }

    int largestPrime = primeNumbers[0];
    for (int i = 1; i < primeNumbers.size(); i++) {
        if (primeNumbers[i] > largestPrime) {
            largestPrime = primeNumbers[i];
        }
    }

    return sumOfDigits(largestPrime);
}


