int next_smallest(vector<int> lst) {
    if (lst.empty()) {
        return -1; // Return -1 to indicate None
    }

    sort(lst.begin(), lst.end()); // Sort the input vector in ascending order

    auto last = unique(lst.begin(), lst.end()); // Remove duplicates from the sorted vector
    lst.erase(last, lst.end());

    if (lst.size() < 2) {
        return -1; // Return -1 to indicate None
    }

    return lst[1]; // Return the second smallest element
}


