bool check_dict_case(map<string, string> dict) {
    // Check if the given map is empty
    if (dict.empty()) {
        return false;
    }

    // Check if all keys in the map are strings
    for (auto const& pair : dict) {
        if (pair.first.find_first_not_of("abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ") != string::npos) {
            return false;
        }
    }

    // Check if all keys in the map are either in lower case or upper case
    for (auto const& pair : dict) {
        bool all_lower = true;
        bool all_upper = true;
        for (char c : pair.first) {
            if (!islower(c)) {
                all_lower = false;
            }
            if (!isupper(c)) {
                all_upper = false;
            }
        }
        if (!all_lower && !all_upper) {
            return false;
        }
    }

    return true;
}


