string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }

    int sum = 0;
    int count = 0;
    for (int i = n; i <= m; i++) {
        sum += i;
        count++;
    }

    int average = sum / count;
    int rounded_average = floor(average);

    string binary = "";
    while (rounded_average > 0) {
        binary = to_string(rounded_average % 2) + binary;
        rounded_average /= 2;
    }

    return binary;
}


