int closest_integer(string value) {
    double num = stod(value); // Parse the input string value into a floating-point number

    int floor_num = floor(num); // Calculate the floor value of the parsed number
    int ceil_num = ceil(num); // Calculate the ceiling value of the parsed number

    double diff_floor = abs(num - floor_num); // Calculate the absolute difference between the parsed number and its floor value
    double diff_ceil = abs(num - ceil_num); // Calculate the absolute difference between the parsed number and its ceiling value

    if (diff_floor <= diff_ceil) { // Check if the floor value is closer
        return floor_num; // Return the floor value as the closest integer
    } else {
        return ceil_num; // Return the ceiling value as the closest integer
    }
}


