bool isPalindrome(int num) {
    string str = to_string(num);
    int left = 0;
    int right = str.length() - 1;

    while (left < right) {
        if (str[left] != str[right]) {
            return false;
        }
        left++;
        right--;
    }

    return true;
}

vector<int> even_odd_palindrome(int n) {
    vector<int> result(2, 0); // Initialize vector with 2 zeros for even and odd counts
    for (int i = 1; i <= n; i++) {
        if (isPalindrome(i)) {
            if (i % 2 == 0) {
                result[0]++; // Increment even count
            } else {
                result[1]++; // Increment odd count
            }
        }
    }
    return result;
}


