int count_nums(std::vector<int> n) {
    if (n.empty()) {
        return 0;
    }

    int count = 0;
    for (int num : n) {
        int sum = 0;
        int temp = abs(num);
        while (temp != 0) {
            sum += temp % 10;
            temp /= 10;
        }
        if (sum > 0) {
            count++;
        }
    }

    return count;
}


