bool move_one_ball(vector<int> arr) {
    // Check if the given vector is empty
    if (arr.empty()) {
        return true;
    }

    // Check if the vector is already sorted in non-decreasing order
    bool sorted = true;
    for (int i = 1; i < arr.size(); i++) {
        if (arr[i] < arr[i - 1]) {
            sorted = false;
            break;
        }
    }
    if (sorted) {
        return true;
    }

    // Determine if it is possible to obtain a sorted vector by performing right shift operations
    int n = arr.size();
    for (int i = 0; i < n; i++) {
        bool possible = true;
        for (int j = 0; j < n; j++) {
            if (arr[(j + i) % n] > arr[(j + i + 1) % n]) {
                possible = false;
                break;
            }
        }
        if (possible) {
            return true;
        }
    }

    return false;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (move_one_ball({3, 4, 5, 1, 2})==true);
    assert (move_one_ball({3, 5, 10, 1, 2})==true);
    assert (move_one_ball({4, 3, 1, 2})==false);
    assert (move_one_ball({3, 5, 4, 1, 2})==false);
    assert (move_one_ball({})==true);
}

