using namespace std;

string exchange(vector<int> lst1, vector<int> lst2) {
    // Check if all elements in lst1 are already even
    bool allEven = all_of(lst1.begin(), lst1.end(), [](int num) { return num % 2 == 0; });
    if (allEven) {
        return "YES";
    }

    // Check if there are any odd elements in lst1 that can be exchanged with even elements in lst2
    for (int i = 0; i < lst1.size(); i++) {
        if (lst1[i] % 2 != 0) {
            for (int j = 0; j < lst2.size(); j++) {
                if (lst2[j] % 2 == 0) {
                    swap(lst1[i], lst2[j]);
                    break;
                }
            }
        }
    }

    // Check if all elements in lst1 are even after the exchange
    allEven = all_of(lst1.begin(), lst1.end(), [](int num) { return num % 2 == 0; });
    if (allEven) {
        return "YES";
    }

    return "NO";
}

