long long minSubArraySum(vector<long long> nums) {
    long long minSum = LLONG_MAX; // Initialize minimum sum to a large value
    int n = nums.size();

    for (int i = 0; i < n; i++) {
        long long sum = 0;
        for (int j = i; j < n; j++) {
            sum += nums[j];
            minSum = min(minSum, sum);
        }
    }

    return minSum;
}

