int max_fill(vector<vector<int>> grid, int capacity) {
    int total_times_lowered = 0;

    for (int i = 0; i < grid.size(); i++) {
        int total_water = 0;
        for (int j = 0; j < grid[i].size(); j++) {
            total_water += grid[i][j];
        }

        int buckets_needed = ceil((double)total_water / capacity);
        total_times_lowered += buckets_needed;
    }

    return total_times_lowered;
}


