bool isConsonant(char c) {
    c = tolower(c);
    return !(c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u' || c == ' ');
}

vector<string> select_words(string s, int n) {
    vector<string> words;
    string word = "";
    vector<string> result;

    for (char c : s) {
        if (c == ' ') {
            if (!word.empty()) {
                words.push_back(word);
                word = "";
            }
        } else {
            word += c;
        }
    }

    if (!word.empty()) {
        words.push_back(word);
    }

    for (string w : words) {
        int consonantCount = count_if(w.begin(), w.end(), isConsonant);
        if (consonantCount == n) {
            result.push_back(w);
        }
    }

    return result;
}


