#include <stack>

string match_parens(vector<string> lst) {
    // Step 1: Check if the number of open and close parentheses in each string is equal
    int openCount1 = 0, closeCount1 = 0, openCount2 = 0, closeCount2 = 0;
    for (char c : lst[0]) {
        if (c == '(') openCount1++;
        else if (c == ')') closeCount1++;
    }
    for (char c : lst[1]) {
        if (c == '(') openCount2++;
        else if (c == ')') closeCount2++;
    }
    if (openCount1 != closeCount1 || openCount2 != closeCount2) {
        return "No";
    }

    // Step 2: Check if the parentheses in each string are balanced
    auto isBalanced = [](const string& s) {
        stack<char> st;
        for (char c : s) {
            if (c == '(') {
                st.push(c);
            } else if (c == ')') {
                if (st.empty() || st.top() != '(') {
                    return false;
                }
                st.pop();
            }
        }
        return st.empty();
    };

    if (!isBalanced(lst[0]) || !isBalanced(lst[1])) {
        return "No";
    }

    // Step 3: Concatenate the two strings in all possible orders and check if the resulting string is balanced
    string concat = lst[0] + lst[1];
    for (int i = 0; i < 2; i++) {
        for (int j = 0; j < 2; j++) {
            string temp = lst[i] + lst[1 - i];
            if (isBalanced(temp)) {
                return "Yes";
            }
        }
    }

    return "No";
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (match_parens({"()(", ")"}) == "Yes");
    assert (match_parens({")", ")"}) == "No");
    assert (match_parens({"(()(())", "())())"}) == "No");
    assert (match_parens({")())", "(()()("}) == "Yes");
    assert (match_parens({"(())))", "(()())(("}) == "Yes");
    assert (match_parens({"()", "())"}) == "No");
    assert (match_parens({"(()(", "()))()"}) == "Yes");
    assert (match_parens({"((((", "((())"}) == "No");
    assert (match_parens({")(()", "(()("}) == "No");
    assert (match_parens({")(", ")("}) == "No");
    assert (match_parens({"(", ")"}) == "Yes");
    assert (match_parens({")", "("}) == "Yes" );
}

