vector<int> generate_collatz_sequence(int n) {
    vector<int> collatz_seq;
    collatz_seq.push_back(n);
    while (n != 1) {
        if (n % 2 == 0) {
            n = n / 2;
        } else {
            n = 3 * n + 1;
        }
        collatz_seq.push_back(n);
    }
    return collatz_seq;
}

vector<int> filter_odd_numbers(const vector<int>& collatz_seq) {
    vector<int> odd_numbers;
    for (int num : collatz_seq) {
        if (num % 2 != 0) {
            odd_numbers.push_back(num);
        }
    }
    return odd_numbers;
}

vector<int> get_odd_collatz(int n) {
    vector<int> collatz_seq = generate_collatz_sequence(n);
    vector<int> odd_numbers = filter_odd_numbers(collatz_seq);
    sort(odd_numbers.begin(), odd_numbers.end());
    return odd_numbers;
}

