using namespace std;

vector<string> split_words(string txt) {
    vector<string> result;

    size_t foundSpace = txt.find(" ");
    size_t foundComma = txt.find(",");

    if (foundSpace != string::npos) {
        size_t start = 0;
        size_t end = txt.find(" ");
        while (end != string::npos) {
            result.push_back(txt.substr(start, end - start));
            start = end + 1;
            end = txt.find(" ", start);
        }
        result.push_back(txt.substr(start));
    } else if (foundComma != string::npos) {
        size_t start = 0;
        size_t end = txt.find(",");
        while (end != string::npos) {
            result.push_back(txt.substr(start, end - start));
            start = end + 1;
            end = txt.find(",", start);
        }
        result.push_back(txt.substr(start));
    } else {
        int oddCount = 0;
        for (char c : txt) {
            if (islower(c) && ((c - 'a') % 2 == 1)) {
                oddCount++;
            }
        }
        result.push_back(to_string(oddCount));
    }

    return result;
}


