bool is_sorted(vector<int> lst) {
    // Step 2: Sort the vector in ascending order
    vector<int> sorted_lst = lst;
    sort(sorted_lst.begin(), sorted_lst.end());

    // Step 3: Check if the sorted vector is equal to the original vector
    if (lst != sorted_lst) {
        return false;
    }

    // Step 4: Check if any number appears more than twice in the vector
    unordered_map<int, int> freq;
    for (int num : lst) {
        freq[num]++;
        if (freq[num] > 2) {
            return false;
        }
    }

    // Step 5: If all conditions are met, return true
    return true;
}

