double poly(vector<double> xs, double x){
    double sum = 0;
    for (int i = 0; i < xs.size(); i++){
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double find_zero(vector<double> xs){
    double zero_point = 0.0;
    if (xs.size() % 2 == 0 && xs.back() != 0){
        // Implementing a simple root finding algorithm
        double epsilon = 0.0001; // Tolerance for convergence
        double x0 = 0.0; // Initial guess for the root
        double x1 = 1.0; // Another initial guess for the root
        while (abs(poly(xs, x1)) > epsilon){
            double temp = x1;
            x1 = x1 - poly(xs, x1) * (x1 - x0) / (poly(xs, x1) - poly(xs, x0));
            x0 = temp;
        }
        zero_point = x1;
    }
    return zero_point;
}

#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

