vector<int> tri(int n) {
    if (n == 0) {
        return {0};
    } else if (n == 1) {
        return {0, 1};
    } else if (n == 2) {
        return {0, 1, 1};
    }

    vector<int> result(n + 1);
    result[0] = 0;
    result[1] = 1;
    result[2] = 1;

    for (int i = 3; i <= n; i++) {
        if (i % 2 == 0) {
            result[i] = 1 + i / 2;
        } else {
            result[i] = result[i - 1] + result[i - 2] + result[i - 3];
        }
    }

    return result;
}

