int digits(int n) {
    if (n <= 0) {
        return 0;
    }

    int product = 1;
    std::string numStr = std::to_string(n);

    for (char c : numStr) {
        int digit = c - '0';
        if (digit % 2 != 0) {
            product *= digit;
        }
    }

    if (product == 1) {
        return 0;
    }

    return product;
}


