bool isValid(int x, int y, int n) {
    return x >= 0 && x < n && y >= 0 && y < n;
}

void findMinPath(vector<vector<int>>& grid, vector<int>& path, vector<int>& minPath, int k, int x, int y, int n) {
    if (path.size() == k) {
        if (minPath.empty() || path < minPath) {
            minPath = path;
        }
        return;
    }

    int dx[] = {0, 0, 1, -1};
    int dy[] = {1, -1, 0, 0};

    for (int i = 0; i < 4; i++) {
        int newX = x + dx[i];
        int newY = y + dy[i];

        if (isValid(newX, newY, n)) {
            path.push_back(grid[newX][newY]);
            findMinPath(grid, path, minPath, k, newX, newY, n);
            path.pop_back();
        }
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<int> path, minPath;

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            path.push_back(grid[i][j]);
            findMinPath(grid, path, minPath, k, i, j, n);
            path.pop_back();
        }
    }

    return minPath;
}

