bool is_nested(std::string str) {
    // Check if the input string contains only square brackets
    for (char c : str) {
        if (c != '[' && c != ']') {
            return false;
        }
    }

    // Generate all possible subsequence combinations of the brackets
    int n = str.length();
    for (int i = 0; i < (1 << n); i++) {
        std::string subsequence = "";
        for (int j = 0; j < n; j++) {
            if (i & (1 << j)) {
                subsequence += str[j];
            }
        }

        // Check if the subsequence is nested
        std::stack<char> stack;
        for (char c : subsequence) {
            if (c == '[') {
                stack.push(c);
            } else if (c == ']') {
                if (stack.empty() || stack.top() != '[') {
                    break;
                }
                stack.pop();
            }
        }

        if (stack.empty()) {
            return true;
        }
    }

    return false;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_nested("[[]]") == true);
    assert (is_nested("[]]]]]]][[[[[]") == false);
    assert (is_nested("[][]") == false);
    assert (is_nested(("[]")) == false);
    assert (is_nested("[[[[]]]]") == true);
    assert (is_nested("[]]]]]]]]]]") == false);
    assert (is_nested("[][][[]]") == true);
    assert (is_nested("[[]") == false);
    assert (is_nested("[]]") == false);
    assert (is_nested("[[]][[") == true);
    assert (is_nested("[[][]]") == true);
    assert (is_nested("") == false);
    assert (is_nested("[[[[[[[[") == false);
    assert (is_nested("]]]]]]]]") == false);
}

