bool is_equal_to_sum_even(int n) {
    // Check if the given number n is even or not
    if (n % 2 != 0) {
        return false;
    }

    // Check if the given number n is greater than or equal to 8
    if (n < 8) {
        return false;
    }

    // Check if the given number n can be expressed as the sum of 4 positive even numbers
    int count = 0;
    for (int i = 2; i <= n / 2; i++) {
        if ((n - i) % 2 == 0 && i % 2 == 0) {
            count++;
        }
    }

    if (count == 4) {
        return true;
    } else {
        return false;
    }
}


