string fix_spaces(string text) {
    bool spaceFlag = false;
    string result = "";

    for (char c : text) {
        if (c == ' ') {
            if (!spaceFlag) {
                result += '_';
                spaceFlag = true;
            }
        } else {
            result += c;
            spaceFlag = false;
        }
    }

    for (int i = 0; i < result.size() - 2; i++) {
        if (result[i] == '_' && result[i + 1] == '_' && result[i + 2] == '_') {
            result[i] = '-';
            result.erase(i + 1, 2);
        }
    }

    return result;
}

