            word = "";
        } else {
            word += c;
        }
    }
    words.push_back(word);

    string result = "";
    for (string w : words) {
        if (isPrime(w.length())) {
            result += w + " ";
        }
    }
    if (!result.empty()) {
        result.pop_back(); // Remove the extra space at the end
    }
    return result;
}


