vector<string> bf(string planet1, string planet2) {
    vector<string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
    vector<string> result;

    // Validate if planet1 and planet2 are correct planet names
    if (find(planets.begin(), planets.end(), planet1) == planets.end() || find(planets.begin(), planets.end(), planet2) == planets.end()) {
        return result; // Return empty vector if planet1 or planet2 are not correct planet names
    }

    // Determine the orbits of planet1 and planet2
    int orbit1 = find(planets.begin(), planets.end(), planet1) - planets.begin();
    int orbit2 = find(planets.begin(), planets.end(), planet2) - planets.begin();

    // Identify all planets whose orbits are located between the orbit of planet1 and the orbit of planet2
    int start = min(orbit1, orbit2) + 1;
    int end = max(orbit1, orbit2);
    for (int i = start; i < end; i++) {
        result.push_back(planets[i]);
    }

    // Sort the identified planets by proximity to the sun
    sort(result.begin(), result.end(), [&](const string &a, const string &b) {
        return find(planets.begin(), planets.end(), a) < find(planets.begin(), planets.end(), b);
    });

    return result;
}


