string solve(string s) {
    bool hasLetters = false;

    for (char c : s) {
        if (isalpha(c)) {
            hasLetters = true;
            break;
        }
    }

    if (!hasLetters) {
        reverse(s.begin(), s.end());
        return s;
    }

    for (char& c : s) {
        if (isalpha(c)) {
            if (islower(c)) {
                c = toupper(c);
            } else {
                c = tolower(c);
            }
        }
    }

    return s;
}

