int do_algebra(const std::vector<std::string>& operato, const std::vector<int>& operand) {
    if (operato.size() != operand.size() - 1) {
        std::cerr << "Invalid input: Operator vector size should be one less than operand vector size." << std::endl;
        return 0;
    }

    int result = operand[0];
    for (size_t i = 0; i < operato.size(); ++i) {
        if (operato[i] == "+") {
            result += operand[i + 1];
        } else if (operato[i] == "-") {
            result -= operand[i + 1];
        } else if (operato[i] == "*") {
            result *= operand[i + 1];
        } else if (operato[i] == "//") {
            if (operand[i + 1] != 0) {
                result /= operand[i + 1];
            } else {
                std::cerr << "Division by zero error." << std::endl;
                return 0;
            }
        } else if (operato[i] == "**") {
            result = pow(result, operand[i + 1]);
        } else {
            std::cerr << "Invalid operator: " << operato[i] << std::endl;
            return 0;
        }
    }

    return result;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (do_algebra({"**", "*", "+"}, {2, 3, 4, 5}) == 37);
    assert (do_algebra({"+", "*", "-"}, {2, 3, 4, 5}) == 9);
    assert (do_algebra({"//", "*"}, {7, 3, 4}) == 8);
}

