std::vector<int> make_a_pile(int n) {
    std::vector<int> stones;
    stones.push_back(n); // First level has n stones

    for (int i = 1; i < n; i++) {
        if (n % 2 == 0) {
            n += 1; // Next even number
        } else {
            n += 2; // Next odd number
        }
        stones.push_back(n);
    }

    return stones;
}

