int count_ones(int num) {
    int count = 0;
    while (num) {
        count += num & 1;
        num >>= 1;
    }
    return count;
}

bool customComparator(int a, int b) {
    int onesA = count_ones(a);
    int onesB = count_ones(b);

    if (onesA == onesB) {
        return a < b;
    }

    return onesA < onesB;
}

vector<int> sort_array(vector<int> arr) {
    sort(arr.begin(), arr.end(), customComparator);
    return arr;
}

